import ListShows from "./listShows";
import { seenOnBway } from "./seenOnBway";
import './App.css';

function App() {
    return (
        <div className="App">
            <h2>(in chronological order)</h2>
            <h3><a href="./AddAShow.js">Click Here to add your shows!</a></h3>
            <div class="grid-container">
                <ListShows data={seenOnBway} />
            </div>
        </div>
    );
}
export default App;
